import * as style from "../../css/light/profileListContainer"

export default function ProfileListItem({data}) {
  const convertData = () => {
    let temp = []
    Object.keys(data).slice(1).forEach((item, i) => {
      temp.push(data[i]['data'])
    })
  
    return temp.splice(1)
  }

  const renderListDataMain = () => {
    return (
      <div style={style.profileListContainerMain}>
        {data[0]['data']}
      </div>
    )
  }

  const renderListDataOther = () => {
    const renderDataList = () => {
      return convertData().map((item, i) => (
        <div key={`LData${i}`} style={style.profileListContainerOther}>{item}</div>
      ))
    }

    return (
      <div style={{display: "flex", width: "100%", marginLeft: "10px"}}>
        {renderDataList()}
      </div>
    )
  }

  return (
    <div>
      <div 
      onMouseEnter={(e) => {
        e.currentTarget.style.border = "1px solid black"
      }}
      onMouseLeave={(e) => {
        e.currentTarget.style.border = "1px solid #4382BC"
      }}
      style={style.profileListContainer}>
        {renderListDataMain()}
        {renderListDataOther()}
      </div>
      <div style={{height: "3px"}}></div>
    </div>
  )
}
